DROP TABLE IF EXISTS `t_admin`;
CREATE TABLE `t_admin` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `account` varchar(12) NOT NULL COMMENT '账号',
  `real_name` varchar(8) DEFAULT NULL COMMENT '真实姓名',
  `job_number` varchar(64) DEFAULT '' COMMENT '工号',
  `mobile` bigint(11) DEFAULT NULL COMMENT '手机号码',
  `time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '时间',
  `status` int(1) NOT NULL DEFAULT '1' COMMENT '状态，1正常，0删除',
  `password` varchar(64) NOT NULL COMMENT '密码',
  `email` varchar(40) DEFAULT NULL COMMENT '邮箱',
  `last_login_ip` varchar(20) DEFAULT NULL COMMENT '最后登入IP',
  `last_login_time` datetime DEFAULT NULL COMMENT '最后登入时间',
  `type` int(1) NOT NULL DEFAULT '1' COMMENT '管理员类型 1管理员 2店长 ',
  `lock_flag` int(1) DEFAULT '0' COMMENT '锁定状态，0正常，1锁定',
  `photoimg` varchar(255) DEFAULT NULL COMMENT '头像',
  `start_lock_time` datetime DEFAULT NULL,
  `end_lock_time` datetime DEFAULT NULL,
  `isuse` int(1) DEFAULT '1' COMMENT '是否使用(1是，0否)',
  `lastupdate` datetime DEFAULT NULL,
  `is_del` int(11) DEFAULT '0' COMMENT '是否删除：1、是；0、否',
  PRIMARY KEY (`id`),
  KEY `idx_account` (`account`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8 COMMENT='管理员';

